import { useHistory } from 'react-router-dom'

const Home = () => {
  const history = useHistory();

  const handlePlay = (e) => {
    console.log('play')
  }

  const handleRules = (e) => {
    console.log('rules')
    history.push("/rules")
  }

  return (
    <Fragment>
      <h1>The Juniper Green Game</h1>
      <button onClick={(e) => handlePlay()}>Play</button>
      <button onClick={(e) => handleRules()}>Rules</button>
    </Fragment>
  );
}

export default Home;
